import { motion } from 'framer-motion';
import { 
  UserGroupIcon,
  StarIcon,
  HeartIcon,
  UserIcon,
  CheckIcon
} from '@heroicons/react/24/outline';

const RoomTypesSection = () => {
  const roomTypes = [
    {
      id: 1,
      name: 'Camere Double Standard',
      icon: 'üõå',
      description: 'Camere spa»õioase »ôi luminoase, dotate cu toate facilitƒÉ»õile necesare pentru o »ôedere confortabilƒÉ.',
      features: [
        'Baie cu cabinƒÉ de du»ô',
        'Minibar',
        'Wi-Fi gratuit',
        'TV prin cablu',
        'Telefon',
        'Balcon cu vedere spre munte'
      ],
      target: 'Cupluri, turi»ôti relaxa»õi',
      image: 'https://images.unsplash.com/photo-1631049307264-da0ec9d70304?ixlib=rb-4.0.3&auto=format&fit=crop&w=2070&q=80',
      price: '65 USD',
      size: '‚âà20 m¬≤'
    },
    {
      id: 2,
      name: 'Camere Double de Lux',
      icon: 'üõå',
      description: 'Camere mai mari, pentru un plus de confort »ôi elegan»õƒÉ, perfecte pentru oaspe»õii care apreciazƒÉ luxul.',
      features: [
        'Pat matrimonial',
        'Baie cu cadƒÉ',
        'Toate dotƒÉrile standard',
        'Vedere panoramicƒÉ',
        'Spa»õiu de relaxare',
        'Design premium'
      ],
      target: 'Cupluri, escapade romantice, oaspe»õi premium',
      image: 'https://images.unsplash.com/photo-1571896349842-33c89424de2d?ixlib=rb-4.0.3&auto=format&fit=crop&w=2070&q=80',
      price: '95 USD',
      size: '‚âà26 m¬≤'
    },
    {
      id: 3,
      name: 'CamerƒÉ MatrimonialƒÉ',
      icon: 'üõå',
      description: 'IdealƒÉ pentru 2 persoane, confort superior, cu pat mare »ôi priveli»ôte excep»õionalƒÉ.',
      features: [
        'Pat matrimonial mare',
        'Baie elegantƒÉ',
        'Balcon privat',
        'Vedere la munte',
        'Decor romantic',
        'Spa»õiu generos'
      ],
      target: 'Cupluri, escapade romantice',
      image: 'https://images.unsplash.com/photo-1582719478250-c89cae4dc85b?ixlib=rb-4.0.3&auto=format&fit=crop&w=2070&q=80',
      price: '85 USD',
      size: '‚âà24 m¬≤'
    },
    {
      id: 4,
      name: 'CamerƒÉ Single',
      icon: 'üõèÔ∏è',
      description: 'CamerƒÉ compactƒÉ pentru o singurƒÉ persoanƒÉ, cu toate dotƒÉrile standard »ôi confortul necesar.',
      features: [
        'Pat single confortabil',
        'Baie cu du»ô',
        'Wi-Fi gratuit',
        'TV prin cablu',
        'Minibar',
        'Design func»õional'
      ],
      target: 'CƒÉlƒÉtori individuali, business',
      image: 'https://images.unsplash.com/photo-1445019980597-93fa8acb246c?ixlib=rb-4.0.3&auto=format&fit=crop&w=2074&q=80',
      price: '45 USD',
      size: '‚âà16 m¬≤'
    }
  ];

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.2
      }
    }
  };

  const cardVariants = {
    hidden: { opacity: 0, y: 30 },
    visible: { opacity: 1, y: 0 }
  };

  return (
    <section className="section-padding bg-background-secondary">
      <div className="container-custom">
        {/* Section Header */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.8 }}
          className="text-center mb-16"
        >
          <h2 className="text-3xl md:text-4xl lg:text-5xl font-display font-bold text-text-primary mb-4">
            Tipuri de Camere Disponibile
