                  <div className="flex items-center space-x-2">
                    <UserGroupIcon className="w-4 h-4 text-primary-500" />
                    <span className="text-sm font-medium text-primary-700">
                      Public »õintƒÉ: {room.target}
                    </span>
                  </div>
                </div>

                {/* CTA Button */}
                <motion.button
                  whileHover={{ scale: 1.02 }}
                  whileTap={{ scale: 0.98 }}
                  className="w-full btn-primary"
                >
                  RezervƒÉ AceastƒÉ CamerƒÉ
                </motion.button>
              </div>
            </motion.div>
          ))}
        </motion.div>

        {/* Additional Info */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.8, delay: 0.4 }}
          className="mt-16 bg-gradient-to-r from-primary-50 to-background-primary rounded-2xl p-8 md:p-12"
        >
          <div className="text-center">
            <div className="text-4xl mb-4">üí°</div>
            <h3 className="text-2xl font-display font-bold text-text-primary mb-4">
              Acces Gratuit la Centrul de Relaxare
            </h3>
            <p className="text-text-light max-w-2xl mx-auto">
              Toate camerele beneficiazƒÉ de acces gratuit la centrul de relaxare al hotelului, 
              care include saunƒÉ, jacuzzi »ôi salƒÉ de fitness.
            </p>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default RoomTypesSection;
